import { number } from "prop-types";
import styled from "styled-components";

const Father = styled.div`
  display: flex;
  gap: 10px;
`;
const Box = styled.div`
  background-color: ${(props) => props.bgColor};
  width: 100px;
  height: 100px;
`;

const Circle = styled(Box)`
  border-radius: 50px;
`;

const NumberInput = styled.input.attrs({ typeof: number })`
  width: 100px;
`;

const Text = styled.span`
  color: white;
`;
function App() {
  return (
    <Father>
      <Box bgColor="tomato">
        <Text>Hello</Text>
      </Box>
      <Circle bgColor="teal" />
    </Father>
  );
}

export default App;
